INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (7, "フリーマーケット会場", 8, 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 40, 2, 10118, 5118061, 0, 1, "青空の下で謁見", "ペコリーヌとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (7, "フリーマーケット会場", 8, 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 40, 2, 10118, 5118062, 0, 1, "未来の騎空団\nマスコット？", "マホとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (7, "ランドソル市街地", 8, 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 40, 2, 10118, 5118063, 0, 1, "お嬢さまからの\n緊急依頼", "アキノとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (18, "フリーマーケット会場", 8, 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 40, 2, 10118, 5118064, 0, 1, "黄金色の悩みごと", "ジュンとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (18, "フリーマーケット会場", 8, 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 40, 2, 10118, 5118065, 0, 1, "白熱！　格闘大会！", "カオリとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (16, "オーエド町", 8, 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 40, 2, 10118, 5118066, 0, 1, "祭り太鼓はオーエドの華", "ニノンとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (19, "フリーマーケット会場", 8, 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 40, 3, 10118, 5118067, 0, 1, "人気者は遅れて\nやってくる", "スズナとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (18, "ランドソル市街地", 8, 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 40, 3, 10118, 5118068, 0, 1, "巫女・ミーツ・魔法少女", "ナナカとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (18, "フリーマーケット会場", 8, 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 40, 3, 10118, 5118069, 0, 1, "ネズ耳は二度なくなる", "キャル＆コッコロとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (18, "ランドソル市街地", 8, 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 40, 3, 10118, 5118070, 0, 1, "この出会いにカンパイ！", "ユカリとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (18, "ランドソル市街地", 8, 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 40, 3, 10118, 5118071, 0, 1, "陰陽アンサンブル", "アオイとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (7, "フリーマーケット会場", 8, 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 40, 3, 10118, 5118072, 0, 1, "運試し十番勝負！", "シノブとの出会い", 91002);
INSERT INTO `v1_ab4a713504f6b90944220c36d938d164b7558d03645b497a8ac0f695f568b679` VALUES (0, 0, 0, 0, 0, 0, 0, 1, 10118, 5118600, 10145115, 0, "彼女たちの新たな日常", "オープニング", 0);
